# Import core libraries
import pandas as pd
import numpy as np
import json
import matplotlib.pyplot as plt
import seaborn as sns
from sklearn.preprocessing import MinMaxScaler

from google.colab import files
uploaded = files.upload()

with open('/content/user-wallet-transactions.json') as f:
    data = json.load(f)

# Preview one record
data[0]

#Convert JSON to DataFrame
df = pd.DataFrame(data)
df.head()

""" Feature Engineering per Wallet"""

wallets = df['userWallet'].unique()
features = []

for wallet in wallets:
    wallet_data = df[df['userWallet'] == wallet]
    total_tx = len(wallet_data)
    action_counts = wallet_data['action'].value_counts().to_dict()
    total_amount = wallet_data.groupby('action')['actionData'].apply(lambda x: sum(float(item['amount']) for item in x if 'amount' in item)).to_dict()

    repay_to_borrow_ratio = (
        total_amount.get('repay', 0) / total_amount.get('borrow', 1)
    )
    last_activity = wallet_data['timestamp'].max()

    features.append({
        'wallet': wallet,
        'total_tx': total_tx,
        'deposit_count': action_counts.get('deposit', 0),
        'borrow_count': action_counts.get('borrow', 0),
        'repay_count': action_counts.get('repay', 0),
        'redeem_count': action_counts.get('redeemunderlying', 0),
        'liquidation_count': action_counts.get('liquidationcall', 0),
        'total_deposited': total_amount.get('deposit', 0),
        'total_borrowed': total_amount.get('borrow', 0),
        'total_repaid': total_amount.get('repay', 0),
        'repay_to_borrow_ratio': repay_to_borrow_ratio,
        'last_activity': last_activity
    })

features_df = pd.DataFrame(features)
features_df.head()

"""Score Each Wallet (0‚Äì1000)

"""

scaler = MinMaxScaler()
X = features_df.drop(['wallet'], axis=1)
X_scaled = scaler.fit_transform(X)

# Heuristic scoring weights
weights = np.array([
    1,      # total_tx
    1,      # deposit_count
    -0.5,   # borrow_count
    1,      # repay_count
    0.5,    # redeem_count
    -1,     # liquidation_count
    1,      # total_deposited
    -0.5,   # total_borrowed
    1,      # total_repaid
    1,      # repay_to_borrow_ratio
    0.2     # last_activity
])

# Compute raw score
raw_scores = X_scaled @ weights.T
# Normalize to 0‚Äì1000
final_scores = MinMaxScaler(feature_range=(0, 1000)).fit_transform(raw_scores.reshape(-1, 1)).flatten()

features_df['credit_score'] = final_scores
features_df[['wallet', 'credit_score']].head()

features_df[['wallet', 'credit_score']].to_csv('wallet_scores.csv', index=False)

# Download the file
files.download('wallet_scores.csv')

"""Score Distribution Graph (analysis.md)

"""

plt.figure(figsize=(10,6))
sns.histplot(features_df['credit_score'], bins=10, kde=True, color='skyblue')
plt.title("Wallet Credit Score Distribution", fontsize=14)
plt.xlabel("Credit Score")
plt.ylabel("Number of Wallets")
plt.grid(True)
plt.show()



